      out.write("<script>\r\n");
      out.write("	// 글자수 제한 함수\r\n");
      out.write("	function truncateString(str, num) {\r\n");
      out.write("	  if (str.length > num) {\r\n");
      out.write("	    return str.slice(0, num) + \"...\";\r\n");
      out.write("	  } else {\r\n");
      out.write("	    return str;\r\n");
      out.write("	  }\r\n");
      out.write("	}\r\n");
      out.write("	\r\n");
      out.write("	// 상품, 화보, 룩북 및 기타 요소의 name, brand, street 등을 수정하는 함수\r\n");
      out.write("	function truncateDetails() {\r\n");
      out.write("	  // 상품 정보 수정\r\n");
      out.write("	  var productItems = document.querySelectorAll('.product-item, .product-item2, .street-item');\r\n");
      out.write("	  productItems.forEach(function(item) {\r\n");
      out.write("	    var brand = item.querySelector('p'); // brand 또는 street 위치\r\n");
      out.write("	    var name = item.querySelector('h3'); // name 위치\r\n");
      out.write("	     \r\n");
      out.write("	    \r\n");
      out.write("	    // 글자수 제한 적용\r\n");
      out.write("	    if(brand) brand.innerText = truncateString(brand.innerText, 8);\r\n");
      out.write("	    if(name) name.innerText = truncateString(name.innerText, 5);\r\n");
      out.write("	    \r\n");
      out.write("	  });\r\n");
      out.write("	  \r\n");
      out.write("	  // 화보 및 룩북 타이틀 수정 (이전 단계에서 추가된 코드)\r\n");
      out.write("	  var carouselItems = document.querySelectorAll('.carousel-caption');\r\n");
      out.write("	  carouselItems.forEach(function(item) {\r\n");
      out.write("	    // 글자수 제한 적용\r\n");
